  lue\":{\"maxChatsToRead\":100,\"maxProjectsToGroup\":5,\"model\":\"fiercefalc\
  on\",\"promptTemplate\":\"You are analyzing conversation transcripts to
  identify repeated user behaviors.\\n\\n## Transcript Location\\nTranscripts
  are stored at: {{agentTranscriptsPath}}\\n\\n## Transcript Format\\nEach
  '.txt' file is a human-readable conversation transcript with this
  structure:\\n- 'user:' sections contain user messages (often wrapped in
  '<user_query>' tags)\\n- 'assistant:' sections contain assistant responses\\n-
  '[Tool call]' blocks show which tools were invoked\\n- '[Tool result]' blocks
  show tool outputs\\n\\nFiles can be large. Focus on extracting the
  '<user_query>' sections which contain the actual user requests. Do NOT try to
  read the entire file contents because it will pollute your context.\\n\\n##
  How to Read Transcripts\\n1. Use Glob to list files:
  \\\"{{agentTranscriptsPath}}/*.txt\\\"\\n2. For each file, extract just the
  '<user_query>' blocks - these show what users asked for\\n3. You can use Grep
  to search for '<user_query>' patterns across files. If you try and run
  terminal commands they will be rejected.\\n\\n## Task\\nAnalyze the
  {{maxChatsToRead}} most recent conversations (by file modification time). Be
  thorough and do not bias towards recency when analyzing conversations. Ignore
  trivial conversations and conversations where nothing concrete
  happened.\\n\\nYour goal is to understand how the user interacts with the
  agent. Focus especially on the corrections that the user makes repeatedly.
